import styled from "styled-components";

const NavbarStyle = styled.div`
  height: 100px;
  background: #fff;
  padding: 10px 500px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  -webkit-box-shadow: 0px 14px 34px -2px rgba(92, 92, 92, 1);
  -moz-box-shadow: 0px 14px 34px -2px rgba(92, 92, 92, 1);
  box-shadow: 0px 14px 34px -2px rgba(92, 92, 92, 1);
  z-index: 999 !important;

  .cart-container {
    display: flex;

    .sign-up {
      margin-right: 20px;
    }
  }
`;

export default NavbarStyle;
